CREATE TABLE IF NOT EXISTS `pwi_convene_custom_modules` (
  `custom_module_id` bigint(20) NOT NULL COMMENT 'The unique id of the custom module',
  `conference_id` bigint(20) DEFAULT '0' COMMENT 'Foreign Key of the conference id',
  `icon` longtext COMMENT 'The url of the icon',
  `name` varchar(100) DEFAULT '' COMMENT 'The name of this module.',
  `type` int(11) DEFAULT '2' COMMENT 'The type of the module. 0:Submenu, 1:URL Link, 2:Video, 3:Content',
  `link_url` varchar(500) DEFAULT '' COMMENT 'The link url. If this module is not url link module, this field is empty.',
  `video_url` varchar(500) DEFAULT '' COMMENT 'The video url. If this module is not video module, this field is empty.',
  `content_img` longtext COMMENT 'The image url. If this module is not content module, this field is empty.',
  `content_desc` text COMMENT 'The content description. If this module is not content module, this field is empty.',
  `parent_id` bigint(20) DEFAULT '0' COMMENT 'The id of parent module. If this module is the root module, this field is 0.',
  `show_order` int(11) DEFAULT '1' COMMENT 'Show order',
  `deleted` bit(1) DEFAULT b'0' COMMENT 'The field to specify if this record is removed or not.'
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 AVG_ROW_LENGTH=34133 COMMENT='The table to manage custom modules.';

